    [],nt"num_tags": 2,nt"name": "seney-national-wildlife-refuge-annual-narrative-report-calendar-year-2001",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Seney
    NWR outlines activities and accomplishments during the 2001 calendar year. The report
    begins with an introduction to the Refuge. Highlights and weather conditions are
    summarized for the year. Information about monitoring and studies- including surveys
    and censuses and studies and investigations- is provided next. Habitat restoration
    and management projects are also covered; activities include wetland restoration,
    riverine restoration, water level management, grazing/mowing/haying, forest management,
    fire management, and vegetation control. Fish and wildlife management are discussed
    next with emphasis on bird banding, reintroductions, nest structures, and animal
    control. Coordination activities, such as interagency coordination, private land
    activities, and cooperative organizations, are outlined. The resource protection
    section provides an update on law enforcement, contaminants, cultural resource management,
    and land acquisition support. Information about public education and recreation
    is given including visitor services and outreach. Finally, general administration
    is discussed in the Refuge planning and administration section.",nt"owner_org":
